import React from 'react';
import { MDBDataTable } from 'mdbreact';
import listmahasiswa from './listmahasiswa'

const DatatablePage = () => {
  const data = {
    
     data: listmahasiswa
   
  };

  return (
    <MDBDataTable
    
      data={data}
    />
  );
}

export default DatatablePage;
